        txn.executeSql("Insert into MANTB_DIGR01 Values ('SL2003-0000122', 7, 'E00192000051', '2010', '20090908',  '20091109', '202', NULL, 'E00192', '(주)동운',  '배문교', 13870, 'C', '정밀점검 결과 \"C\"로 평가, 외관상태는 절리의 발달에 의한 국부적인 사면의 손실, 부석형성 등이 주된 손상으로 조사되어 절토사면의 안전성에는 별다른 영향이 없을 것으로 판단되고, 정기적인 점검 및 관찰을 통해 사면의 이상유무를 파악할 수 있도록 하며, 국부적으로 부석형성 및 낙석의 우려가 있는 구간에 대해서는 부석제거 및 추가보강이 필요하고, 사면이 파괴된 구간에 대해서는 신속한 보수&#8228;보강이 이루어져야 될 것으로 판단됨, 암편시료에 대한 실내시험 결과 전구간이 풍화암에 해당됨.', '낙석방지울타리망 및 와이어 로프 부분 보수 및 시공,부석 제거 및 2중 낙석방지망 설치, Rock Anchor 및 Rock Bolt 보강, 배수구 정비',  NULL, '20100310', '최내인', 'N')  ");
