        txn.executeSql("Insert into MANTB_DIGR01 Values ('SL2003-0000122', 26, 'KISTEC002031', '2018', '20170417',  '20171231', '202', NULL, 'KISTEC', '한국시설안전공단',  '이종건', 10675, 'C', '  종합평가결과를 바탕으로 한 안전등급에서 C등급으로 판정되었다. 0∼120m 구간은 비탈면녹화가 적용되어 있으며 상태가 양호하였다. 120∼700m 구간은 낙석방지울타리, 낙석방지망, 앵커 등으로 보강되어 있으며 낙석 및 뜬돌이 있다. 앵커가 설치된 구간은 낙석방지망이 파손되어 있어 보수가 필요하다. 국부적으로 평면파괴형 암탈락이 발생하였으나 과거에 비해 추가로 진행되지 않았으며 앵커로 보강되어 있어 대규모 붕괴는 발생하지 않을 것으로 판단된다. 700∼1,403m 구간은 비탈면녹화가 실시되어 있으며 종점부는 초본류의 정착상태가 불량하다. 노출된 기반암의 상태가 양호하고 식생이 정착하기 어려운 환경이므로 녹화를 재 실시하는 것은 지양하는 것이 적절하다. 비탈면에는 결함이 발생한 구간에 계단식옹벽이 설치되어 있으며 상태 양호하다.', '- 낙석방지망 보수 - 낙석방지울타리 보수',  NULL, '20180125', '배성우', 'N')  ");
