        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR1990-0000071', 8, 'E00074000006', '2006', '20041229',  '20050711', '401', NULL, 'E00074', '(주)평화엔지니어링',  '정찬구', 65915, 'B', '공용중 발생 가능한 일반적인 손상으로 주기적인 유지관리를 통하여 전반적인 구조물 상태는 양호하며, 주요손상으로 바닥판하면의 콘크리트 열화, 기타 발생된 손상 등은 보수방안에 제안한바와 같이 유지관리를 실시한다면 구조물의 기능성과 사용성에는 문제가 없을 것으로 판단되며, 구조안전성평가결과  기준내하력(DB-24)이상으로 구조안전성 측면에서는 안전한 상태인 것으로 평가되었다.', '교면포장의 일부구간(50%)는 2년전에 재포장을 실시하였으나 바닥판 상면의 손상에 대하여 근본적인 보수를 실시하지 않은 관계로 인하여 바닥판 하면의 대부분 재손상(보수부 들뜸 및 누수, 백태, 균열)이 발생한  상태이다.  따라서 장기적인 방안으로 재포장를 실시하여 바닥한 하면의 콘크리트 내구성 저하의 근본적인 원인에 대한 보수가 실시된후 바닥한 하면의 기타 손상(균열보수, 표면보수, 단면보수등)에 대한 적절한 보수가 실시되어야 한다. 단기적인 방안으로 사용성 및 평탄성에 영향을 미치는 포트홀은 단기적인 보수를 실시하고, 손상이 심한 부위에 대해서는 주기적인 관찰이 필요하다. 그외 보수방안으로 신축이음 고무재노화에 의한 교체, 난간변형에 대한 교체, 물끊기 미제거에 대한 물끊기 설치, 받침장치의 볼트 및 PLATE 부식에 대한 재도장 등의 보수 방안을 제시하였다.',  NULL, '20050921', '이화형', 'N')  ");
        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR1978-0000002', 8, 'E00074000006', '2006', '20041229',  '20050711', '401', NULL, 'E00074', '(주)평화엔지니어링',  '정찬구', 65915, 'C', '공용중 발생 가능한 일반적인 손상으로 주기적인 유지관리를 통하여 전반적인 구조물 상태는 양호하며, 주요손상인 포장면 및 방수층 손상으로 인한 바닥판하면의 콘크리트 열화, 기타 발생된 손상 등은 보수방안에 제안한바와 같이 유지관리를 실시한다면 구조물의 기능성과 사용성에는 문제가 없을 것으로 판단되며, 구조안전성평가결과  기준내하력(DB-24)이상으로 구조안전성 측면에서는 안전한 상태인 것으로 평가되었다.', '교면포장의 상태는 기대수명 이상으로 공용함에 따라 전반적으로 노후손상이 발생된 상태이므로 장기적인 방안으로 재포장를 실시하여 콘크리트 내구성 저하의 근본적인 원인에 대한 보수가 실시된후 바닥한 하면의 기타 손상(균열보수, 표면보수, 단면보수등)에 대한 적절한 보수가 실시되어야 한다. 단기적인 방안으로 사용성 및 평탄성에 영향을 미치는 포트홀은 단기적인 보수를 실시하고, 손상이 심한 부위에 대해서는 주기적인 관찰이 필요하다. 그외 보수방안으로 신축이음재 노화로 인한 교체, PLATE 부식에 대한 재도장, 바닥한 하면에 대한 물끊기설치, 난간이격에 대한 재설치 등의 보수방안을 제시하였다.',  NULL, '20050921', '이화형', 'N')  ");
