        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR1990-0000071', 27, 'E00191000244', '2008', '20070726',  '20071024', '202', NULL, 'E00191', '(주)건설방재기술연구원',  '백승복', 4192, 'B', '주요 손상으로 난간 연석부의 박리, 난간 파손, 바닥판 하면의 백태 및 철근노출, PSC주형의 철근노출 등이 주요 손상으로 조사되었다. 조사된 손상은 구조적 원인에 의해 발생된 손상은 아닌 것으로 콘크리트의 내구성 확보 및 추가적인 2차 손상을 방지하기 위하여 손상에 대해 지속적 점검과 보수가 요구된다.', '균열(0.3mm미만),박리,백태는 표면처리공법 & 철근노출은 단면복구공법적용.',  NULL, '20081117', '탁영균', 'N')  ");
