        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR1999-0000238', 31, 'E00191000396', '2011', '20100413',  '20100731', '401', NULL, 'E00191', '(주)건설방재기술연구원',  '고남영', 29190, 'B', '군포교(상)의 상태평가 및 안전성 평가를 종합적으로 반영한 안전등급은 “B등급” 으로 보조부재에 경미한 결함이 발생하였으나 기능 발휘에는 지장이 없으며 내구성 증진을 위하여 일부의 보수가 필요한 상태이므로 국부적으로 발생한 콘크리트 균열, 강재 부식 등의 보수가 요구된다. 특히, 볼트 이음부 등과 같이 강교 부식 취약부에서 발생한 부식은 녹 제거 후 녹방지 도장 등의 보수를 실시하고 지속적 관리를 통하여 강교의 수명을 연장시키고 안전성을 확보할수 있도록 하여야 할 것으로 판단된다.', '균열 보수, 박리,박락 보수, 철근노출,부식 보수, 차수시설 보수 등',  NULL, '20100825', '탁영균', 'N')  ");
