        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR1978-0000002', 28, 'E00191000244', '2008', '20070726',  '20071024', '202', NULL, 'E00191', '(주)건설방재기술연구원',  '백승복', 4192, 'B', '주요 손상으로 난간 연석부의 박리, 난간 파손, 바닥판 하면의 백태 및 철근노출, PSC주형의 쉬스관 노출 등이 주요 손상으로 조사되었다. 조사된 손상은 구조적 원인에 의해 발생된 손상은 아닌 것으로 콘크리트의 내구성 확보 및 추가적인 2차 손상을 방지하기 위하여 손상에 대해 지속적 점검과 보수가 요구된다.', '백태,박리는 표면처리공법 & 철근노출은,쉬스관노출은 단면복구공법적용.',  NULL, '20081117', '탁영균', 'N')  ");
        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR1990-0000049', 28, 'E00191000244', '2008', '20070726',  '20071024', '202', NULL, 'E00191', '(주)건설방재기술연구원',  '백승복', 5422, 'B', '주요 손상으로 교면포장의 포트홀, 난간 부식, 바닥판 하면의 백태, 미세균열, 주형의 부식, 신축이음 고무 방수재의 열화, 교량받침의 부식이 조사되었다. 조사된 손상은 구조적 원인에 의해 발생된 손상은 아닌 것으로 콘크리트 및 강재의 내구성 확보 및 추가적인 2차 손상을 방지하기 위하여 손상에 대해 지속적 점검과 보수가 요구된다.', '백태는 표면처리공법 & 철근노출은 단면복구공법 & 부식은 재도장공법적용.',  NULL, '20081117', '탁영균', 'N')  ");
        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR2000-0000295', 26, 'E00191000244', '2008', '20070726',  '20071024', '202', NULL, 'E00191', '(주)건설방재기술연구원',  '백승복', 911, 'B', '주요 손상으로 바닥판 하면, 주형, 가로보 교각의 미세 균열과 신축이음 차수시설 탈락 등이 조사되었다. 조사된 손상 중 콘크리트 균열은 구조적 원인에 의해 발생된 손상은 아닌 것으로 기 점검 후 뚜렷한 손상의 진전은 없는 것으로 조사되어 지속적인 점검이 요구되며 신축이음 차수시설의 탈락은 하부 구조물의 부식', '차수시설 탈락은 차수시설 재설치',  NULL, '20081117', '탁영균', 'N')  ");
        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR1978-0000002', 37, 'E00399000105', '2013', '20120215',  '20121011', '202', NULL, 'E00399', '(주)건설품질시험원',  '김현수', 8092, 'C', '본 교량에 대하여 압축강도시험, 탄산화시험, 외관조사, 상세조사 등을 통한 결과를 토대로 전체적인 상태평가 결과 C등급(상태평가점수 0.274)에 해당되며, 『보조부재에 경미한 결함이 발생하였으나, 기능 발휘에는 지장이 없는 상태』로 판단된다. 본 교량의 주요 손상으로는 교면포장 파손 및 방수불량과 그로인한 바닥판 하면의 백태, 열화 및 습윤 등이 조사되었으며. 또한 받침장치의 Plate에 부식이 심화된 상태이다. 발생된 손상에 대해서 점검자가 제시한 보수 방안에 의해 보수를 실시하고 그 외 손상에 대해서도 유지관리 차원에서 보수가 이루어져야 할 것으로 사료된다.', '전경간 아스콘 절삭 후 덧씌우기(LMC), 표면처리공법, 방청후 단면보수공법, 기타부재에 대한 균열보수 및 단면보수공법',  NULL, '20121213', '정명일', 'N')  ");
