        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR1999-0000239', 48, 'E00758000013', '2018', '20170327',  '20170823', '202', NULL, 'E00758', '제이씨엔(주)',  '신학술', 26403, 'B', '-1999년 12월 준공된 군포교(하)에 대한 외관조사 결과 주요결함은 콘크리트 균열, 망상균열, 파손, 박리 및 박락, 교면포장 균열, 망상균열, 받침콘크리트 균열, 강재 녹발생, 거더 도장박리, 부식, 신축이음 후타재 망상균열 등이 조사되었다. -외관조사에 따른 상태평가 및 내구성조사를 종합적으로 고려할 때 교량 구조물의 안전등급은 『보조부재에 경미한 결함이 발생하였으나, 기능발휘에는 지장이 없으며 내구성 증진을 위하여 일부의 보수가 필요한 상태』인 B등급으로 평가되었다.', '-상부구조 : 균열보수, 표면보수, 단면보수 등 -하부구조 : 균열보수, 표면보수, 단면보수 등',  NULL, '20170919', '소정미', 'N')  ");
