        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR1997-0000137', 25, 'E00192000046', '2010', '20090409',  '20090708', '202', NULL, 'E00192', '(주)동운',  '김형우', 2501, 'B', '과업대상 교량인 진안육교는 1997년에 준공되어 약12년간 공용된 교량으로 전반적인 외관상태 및 비파괴시험 결과 양호한 상태이고 구조적 문제를 야기할 손상의 발생은 없는 것으로 나타났다. 그러나 슬래브 하면과 주형의 부식 진행, 후타재, 하부구조 미세 균열에 대한 보수 및 지속적인 점검이 요구된다.', '표면처리, 단면보수, 청소, 도장, 난간교체',  NULL, '20090622', '최내인', 'N')  ");
