        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR2008-0000842', 13, 'E00399000137', '2015', '20140623',  '20141020', '202', NULL, 'E00399', '(주)건설품질시험원',  '김현수', 8142, 'B', '？ 본 교량에 대하여 압축강도시험, 탄산화시험, 외관조사, 상세조사 등을 통한 결과를 토대로 전체적인 상태평가 결과 B등급(상태평가점수 0.199)에 해당되어 『보조부재에 경미한 결함이 발생하였으나, 기능 발휘에는 지장이 없는 상태』로 판단된다. ？ 본 교량은 기 점검 이후 받침장치 1개소((P2-SH3)에서 2.5cm정도 이탈된 것으로 조사되었다. 해당 받침장치 연단거리 측정결과 허용치 35.0cm를 상회하는 것으로 측정되었으며, 연단거리는 확보한 상태로 확인되었으나, 사용성 및 안전성을 위해 받침장치 인상 후 패드 정위치 및 미끄럼 방지턱 설치가 합리적인 보수방안으로 사료되며, 일체형 받침장치로 교체 검토가 요망된다. ？ 그 외 일반적인 콘크리트 손상 외 특이사항 없음', '포트홀 : 소파보수, 배수구 막힘 : 청소, 표면처리공법 및 수지주입공법에 의한 균열보수, 단면보수공법, 받침인상공법 및 받침장치 교체, 교명판 및 설명판 재설치',  NULL, '20141030', '정명일', 'N')  ");
