        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR2007-0000557', 11, 'E00539000018', '2013', '20120214',  '20120615', '202', NULL, 'E00539', '(주)신광엔지니어링',  '박방훈', 2014, 'B', '- 바닥판 캔틸레버는 균열(cw=0.2mm이하)이 발생<br>- 거더(STB)는 강재 긁힘이 발생<br>- 교대는 균열(cw=0.2mm이하), 균열(cw=0.3mm이상), 재료분리, 체수가 발생<br>- 교각은 균열(cw=0.2mm이하), 파손이 발생<br>- 교량받침은 눈금자 탈락이 발생<br>- 신축이음은 후타재균열, 하부 고무 접합부 누수가 발생<br>- 교면포장은 아스콘 포트홀이 발생<br>- 배수시설은 배수구 막힘, 배수관 탈락 발생<br>- 방호벽은 균열(cw=0.2mm이하), 균열(cw=0.3mm이상), 균열부백태가 발생', '표면보수, 주입보수, 단면복구(t=10㎜), 배수관재설치, 청소',  NULL, '20120711', '한두나', 'N')  ");
        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR2007-0000558', 11, 'E00539000018', '2013', '20120214',  '20120615', '202', NULL, 'E00539', '(주)신광엔지니어링',  '박방훈', 2014, 'B', '- 바닥판 캔틸레버는 균열(cw=0.2mm이하)이 발생<br>- 거더(STB)는 강재 긁힘, 하부플랜지 돌출부 부식이 발생<br>- 교대는 균열(cw=0.2mm이하), 균열(cw=0.3mm이상), 박리, 체수가 발생<br>- 교각은 균열(cw=0.2mm이하), 파손, 철근노출, 표면불량이 발생<br>- 교량받침은 앵커볼트 부식이 발생<br>- 신축이음은 후타재균열, 하부 고무 접합부 누수가 발생<br>- 교면포장은 신축이음 주변 체수가 발생<br>- 배수시설은 배수관 탈락이 발생<br>- 방호벽은 균열(cw=0.2mm이하), 균열(cw=0.3mm이상), 균열부백태가 발생', '표면보수, 주입보수, 단면복구(t=10㎜), 단면복구(t=30㎜), 철근방청단면복구, 차수판재설치(BWP), 배수관 재설치',  NULL, '20120711', '한두나', 'N')  ");
        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR2006-0000257', 17, 'E00539000018', '2013', '20120214',  '20120615', '202', NULL, 'E00539', '(주)신광엔지니어링',  '박방훈', 2320, 'B', '- 캔틸레버는 균열(cw=0.1mm), 지점부 파손, 박리, 물끊기홈 파손이 발생<br>- 거더(PSCI)의 외관상태는 전반적으로 양호<br>- 교대는 균열(cw=0.2mm이하), 박리, 열화 및 오염, 콘크리트 적치가 발생<br>- 교각은 균열(cw=0.2mm이하), 콘크리트 적치가 발생<br>- 교량받침은 받침콘크리트 균열, 무수축 몰탈 표면 망상균열, 박리, 받침콘크리트 철근노출 및 철선부식, 플레이트 부식이 발생<br>- 신축이음은 후타재균열, 유간내 토사퇴적이 발생<br>- 교면포장은 아스콘 망상균열 발생<br>- 배수시설의 외관상태는 전반적으로 양호<br>- 방호벽은 박락이 발생', '표면보수, 주입보수, 물끊기홈 교정, 단면복구(t=10㎜), 단면복구(t=30㎜), 청소',  NULL, '20120711', '한두나', 'N')  ");
