        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR2007-0000559', 11, 'E00539000018', '2013', '20120214',  '20120615', '202', NULL, 'E00539', '(주)신광엔지니어링',  '박방훈', 5650, 'B', '- 바닥판 캔틸레버는 균열(cw=0.2mm이하), 재료분리가 발생<br>- 거더(STB)는 강재 긁힘, 하부플랜지 돌출부 부식이 발생<br>- 교대는 균열(cw=0.2mm이하), 열화 및 오염이 발생<br>- 교각은 균열(cw=0.2mm이하), 박리가 발생<br>- 교량받침은 눈금자 탈락, 플레이트 부식이 발생<br>- 신축이음은 후타재균열, 유간내 토사퇴적, 차수판 파손, 하부 고무 접합부 누수가 발생<br>- 교면포장은 아스콘 균열이 발생<br>- 배수시설은 배수구 막힘이 발생<br>- 방호벽은 균열(cw=0.2mm이하), 균열(cw=0.3mm이상), 파손이 발생', '표면보수, 주입보수, 단면복구(t=10㎜), 단면복구(t=30㎜), 도장보수, 차수판재설치(BWP), 청소',  NULL, '20120711', '한두나', 'N')  ");
