        txn.executeSql("Insert into MANTB_DIGR01 Values ('BR2007-0000210', 26, 'E00268000126', '2018', '20170405',  '20171001', '401', NULL, 'E00268', '미래건설산업(주)',  '이희규', 67375, 'B', '외관조사 및 내구성 조사에 의한 “삼기교(상)” 교량 전체 상태평가 결과는 “B&quot; 내하력 평가에 의한 안전성평가 결과 SF&gt;:1.0이상으로서 안전성평가 결과는 “A“ 삼기교(상)”의 안전등급“B등급”에 해당된다.(∵ MIN 상태평가결과 B, 안전성평가결과 A) 공용내하력은 DB-24 이상으로 평가되어 현행 1등급 교량기준 만족한다. 조사된 손상 및 결함개소에 대해서는 교량의 내구성 및 사용성, 안전성 확보를 위해 적정한 보수대책과 지속적인 유지관리는 필요하다. 상부구조인 바닥판하면에 국부적인 균열, 박리？박락이 조사되었고, 거더 및 가로보의 경우 토사물 퇴적 및 오염이 전경간에 걸쳐 발생된 상태이나, 부재에 직접적인 위해요인 보다는 청소가 요구되는 수준이며, 부식이나 녹발생의 경우도 결함의 규모가 작고 경미한 상태로서 장기적인 유지관리계획에 의거 보수가 요구되는 수준이다. 하부구조인 교각 및 교대의 경우 일부 표면처리 보수가 실시된 상태이며, 현재 조사된 결함의 경우 시공초기 건조수축 균열로서 평가되어 내구성 측면에서 보수가 필요한 상태이다. 보조부재인 신축이음 장치의 경우 균열 및 망상균열이 발생된 상태로서 전차년도 점검이후 결함의 진전은 있는것으？？확인되었으나, 하부 누수가 없고 신축이음장치 본체 거동에 이상이 없는 상태이므로 단순한 후타재 균열 보수는 보수 효과가 미비한 상태이므로 주의관찰 후 신축이음장치의 교체시기에 맞게 재설치 하는 것이 바람직 할 것으로 판단되며, 신축덮개의 설치는 필요하다. 받침장치의 경우 경미한 Plate 부식 및 고정볼트 부식, 받침 콘크리트 미세균열 등이 국부적으로 발생된 상태이나, 받침거 이상동이나 편기 등은 없는 상태로서 유지관리 계획에 의거 보수가 요구되는 수준이다. 기타 부재인 난간 및 연석의 경우 전경간에 걸쳐 균열 및 백태, 표면열화 등이 조사되었으며, 내구성 측면에서의 균열 표면보수, 주입보수, 단면보수 등의 단기적인 계획에 의거 보수가 필요한 상태이다. 배수시설의 경우 하천형 및 육교형 배수시설로 설치되어 있으며, 전반적인 유지관리 상태는 양호한 것으로 확인되었으나, A1, A2 지점에 고정된 육교형 배수관의 경우 교량의 신축거동에 따른 탈락이 발생된 상태로서 배수시설 설계미흡으로 판단된다. 기타 시설물인 점검로 출입문의 경우 공용년수 증대에 따른 부식으로 인해 작동이 어려운 상태이므로 재설치가 필요할 것으로 판단된다.', '단면보수, 표면보수, 주입보수, 도장보수, 후타재 보수, 배수관 재설치 등',  NULL, '20171010', '여승원', 'N')  ");
