        txn.executeSql("Insert into MANTB_DIGR01 Values ('RW2011-0000148', 13, 'E00399000194', '2018', '20170410',  '20170707', '202', NULL, 'E00399', '(주)건설품질시험원',  '이재열', 6520, 'A', 'ㅁ 새터교 보강토옹벽의 상태등급 산정결과 환산 결함도점수는 0.01로 상태판정 기준에 의거 상태등급은 &quot;A&quot;등급으로, 『문제점이 없는 최상의 상태』에 해당되는 것으로 조사되었다. ㅁ 본 옹벽(판넬식 보강토)에 대한 외관조사 결과, 구조물의 안전성을 저해할 만한 심각한 손상은 없는 양호한 상태로 조사되었으며, 일부 시공부 미흡에 의한 블록 파손 및 공용중 표면오염이 조사되었다. 그 외 전반적인 옹벽의 수직도 및 주변 현황 등이 양호한 상태로 옹벽을 공용하는데 있어 문제는 없는 것으로 판단된다. ㅁ  발생된 손상은 기점검시에도 조사된 손상으로써 신규 손상 및 손상의 진행은 없는 상태이며, 손상 규모도 미약한 상태로 현 상태에서 발생된 손상은 구조적인 영향이 없는 상태로 즉각적인 보수보다는 주의관찰을 통한 유지관리가 유리할 것으로 판단된다.', '주의관탈을 통한 유지관리',  NULL, '20170726', '정명일', 'N')  ");
