        txn.executeSql("Insert into MANTB_DIGR01 Values ('SL2011-0000094', 10, NULL, '2016', '20150127',  '20150127', '100', '0106', 'A', '자체수행',  '윤중근', 0, '1', '양호', '없음',  NULL, '20150130', '김도형', 'N')  ");
        txn.executeSql("Insert into MANTB_DIGR01 Values ('SL2011-0000094', 12, 'E00803000142', '2017', '20150325',  '20160318', '202', NULL, 'E00803', '한국건설기술연구원',  '구호본', 7994, 'C', '종합평가결과를 바탕으로 한 안전등급에서 C등급으로 판정되었음. 정밀조사 결과,1소 단과 2소단 하부로 조사시점을 기준으로 좌하향하는 층리가 체계적으로 발달해 있으 며, 층리면을 따라 소규모의 암탈락이 발생되고 있음. 30∼270m 구간, 층리면 발달 이 뚜렷한 구간에는 과거 풍화진행 및 불연속면 교합에 따른 암괴탈락이 발생하였으 며, 붕괴 발생구간에 대한 콘크리트뿜어붙이기가 시공되어 있음. 적용공법은 양호한 상태를 보이며, 1, 2, 3 소단 상부 법면은 기반암의 풍화 진행으로 소규모 표층암이 탈락이 발생하고 있으나 적용된 낙석방지망 및 낙석방지울타리에 의하여 포획거리 내 로 포획이 이루어지고 있어 낙석의 도로부 침입 가능성은 낮을 것으로 판단됨. 또한, 인장균열이나 도로부 융기와 같은 대규모 붕괴의 조짐은 관찰되지 않고, 안정해석 실 시한 결과 쐐기, 평면 및 전도파괴 발생 가능성이 인지되지 않으므로 대규모 발생 가 능성이 낮은 것으로 판단됨. 따라서, 대상비탈면의 항구적인 안정성 확보되어 있는 상 태로 현상태유지를 제안함.', '- 12∼280 m 구간 낙석방지망 적용(양호) - 12∼278 m 구간 낙석방지울타리 적용(양호) - 0∼284 m 구간 L형측구 적용(양호) - 72∼107 m, 120∼135 m, 135∼150 m, 170∼190 m 구간 1소단 하부에 및 160∼ 165 m 구간 2소단 하부에 콘크리트 뿜어붙이기 작영 (양호) - 40∼384 m 구간 1, 2, 3소단에 전단면배수구 적용(양호)',  NULL, '20160330', '김승현', 'N')  ");
