        txn.executeSql("Insert into MANTB_DIGR01 Values ('SL2011-0000094', 2, 'E00803000013', '2012', '20110101',  '20111231', '202', NULL, 'E00803', '한국건설기술연구원',  '구호본', 3801, 'C', '상태평과 결과는 \"C\"로 경미한 손상, 결함이 발생하였으나 기능발휘에는 지장이 없으며 내구성 증진을 위하여 일부의 대책공법과 지속적인 관찰이 필요한 상태로 판정되었다. 정밀조사 결과, 1소단 하단부에는 층리절리면을 따라 암탈락이 발생되고 있다. 70∼220 m 층리절리면 발달이 뚜렷한 구간에는 과고의 암괴탈락 발생 구간에 관찰되었며, 추가 암탈락 붕괴 예방하기 위해 콘크리트 뿜어붙이기공 적용되었다. 1, 2, 3 소단 상단 법면부에는 기반암의 지속적인 풍화 진행으로 잔석류 등의 유실물이 지속적으로 발생되고 있으나 대규모 붕괴 징후가 관찰되지 않았다. 낙석방호시설이 시공되어 있고 포획거리가 1.8 m 이상으로 조성되어 있어 낙석의 도로 유입 가능성이 낮은 것으로 판단된다. 또한, 안정해석 실시한 결과 쐐기, 평면 및 전도파괴 발생 가능성이 인지되지 않으므로 대규모 발생 가능성이 낮은 것으로 판단된다. 따라서, 대상비탈면의 항구적인 안정성 확보되어 있는 상태로 현상태유지를 제안한다.', '현상태유지',  NULL, '20120130', '이종현', 'N')  ");
