        txn.executeSql("Insert into MANTB_DIGR01 Values ('SL2005-0000164', 4, 'E00268000123', '2018', '20170407',  '20170707', '202', NULL, 'E00268', '미래건설산업(주)',  '이창민', 18300, 'C', '완주 상관 1/깍기비탈면-다수의 층리가 존재하고 수직절리로 인해 비탈면 내 소규모 낙석(암설) 적재 및 뜬돌 존재하며, 1소단 상부 다수의 낙석(암설)이 포획· 적치됨 비탈면 하부 낙석방지망 미설치 구간 뜬돌과 심한 풍화구간인 0.0m ~  20.0m구간에 대해서는 지속적인 주의관찰이 요구됨. 비탈면 보호/보강시설-낙석방지망 설치·고정상태 양호, 낙석방지울타리 상태양호, 계단식옹벽 간헐적 균열 발생 자연사면-인장균열 조사되지 않음. 배수시설 및 점검시설-전반적인 상태양호 완주 상관 2/깍기비탈면-절리면을 따라 전반적으로 소규모 낙석과 뜬돌이 존재하고, 3소 65.0m~82.0m 구간 일부 유실이 조사됨. 또한 소단 어깨부 부분적인 암탈락과 2소단 어깨부 이완암괴가 존재하고 1,2 소단 상부 일부 구간 낙석이나 암설 적치와 1소단 배수로 균열이 조사됨. 각 소단 관목식생과 암설적치. 비탈면 하부 이완암괴, 암파쇄 및 탈락과 계단식옹벽 미설치 구간 암설의 적재가 조사됨. 비탈면 보호/보강시설 : 낙석방지망 전반적인 설치고정상태 양호하나 4단 비탈면 종점 일부 들뜸 조사, 낙석방지울타리 다수의 낙석존치 및 기능상실, L형 옹벽 균열, 균열/백태 조사, 계단식옹벽 앵커캡 볼트 풀림 1개소. 자연사면-인장균열 조사되지 않음. 배수시설 및 점검시설-측구 주변 토양침식과 낙석 및 암설퇴적, 수직도수로 막힘 완주 상관 4/깍기비탈면-2,3,4단 비탈면 식생불량과 2단 비탈면(110~180m) 소규모 낙석 다수,140m 지점 3단 비탈면은 완전풍화구간으로 산마루에서 비탈면을 따라 토양침식, 2,3소단 일부 유실된 상태로 1소단 어깨부 다수의 암탈락과 30~35m 지점 이완암괴 5.0cm 이격, 2단 비탈면 하부 110~180m 구간  암탈락·이완암괴·주변부 이격· 낙석 적치 등 포획 다수 존재.  비탈면 보호/보강시설-L형 옹벽 균열/백태·스크래치, 계단식옹벽 토사유출·체수·망상 균열·균열·박리,낙석방지울타리 내부 다수 낙석 존치.    자연사면-인장균열 조사되지 않음. 정상부 암괴, 상부자연사면 다수의 전석 배수시설 및 점검시설-배수시설 설치미흡(토양침식), 수직도수로 주변 지표수 유하·도수로 하부와 유도배수관 막힘.', '완주 상관 1 - 낙석방지망 고정상태 주의관찰, 정기적인 청소, 주의관찰 완주 상관 2 - 낙석방지망 고정상태 주의관찰, 주입보수, 소단 재정비, 계단식옹벽 설치, 낙석 제거 및 낙석방지울타리 재설치, 주의관찰 완주 상관 4 - 비탈면 녹화, 배수시설 정비(측구 연장), 낙석방지망 주의관찰, 낙석방지망 재설치,주입보수, 표면보수, 낙석제거(낙석방지울타리 재설치), 주의관찰',  NULL, '20170929', '여승원', 'N')  ");
