        txn.executeSql("Insert into MANTB_DIGR01 Values ('SL2003-0000158', 3, 'KISTEC001948', '2017', '20160422',  '20161223', '202', NULL, 'KISTEC', '한국시설안전공단',  '이종건', 5793, 'C', '  종합평가결과를 바탕으로 한 안전등급에서 C등급으로 판정되었으며, 현장조사 결과 인장균열이나 지반변형 등 대규모 붕괴위험징후는 발견되지 않았다. 20∼180m 구간의 2소단 하부에는 록볼트가 약 1.5m 간격으로 설치되어 있으며 상태가 양호하고 50∼65m 구간의 1소단 하부는 비탈면에 경미한 지하수 누출이 있다. 70∼100m 구간은 우측상단에서 좌측하단방향의 불연속면이 이완되었으며 상단에는 합벽식옹벽이 설치되어 있다. 불연속면의 방향은 비탈면과 유사하여 위험요인으로 작용할 수 있으나 록볼트와 낙석방지망이 설치되어 있어 적절한 보강이 실시된 상태이다. 2소단 상부에는 비탈면녹화가 실시되어 있으며 대규모 붕괴징후는 관찰되지 않았다. 90∼140 구간은 소단의 높이가 약 7m∼14m 정도로 상승하고 소단에는뜬돌이 다수 존재하나 보호·보강상태가 양호하여 낙석이나 붕괴가 발생할 가능성은 낮을 것으로 판단된다. L형측구에는 앵커가 설치되어 있으며 종점부 인근은 앵커가 손상되었으나 L형측구의 전도나 파손은 관찰되지 않았다. 해당구간은 비탈면의 높이나 포획공간으로 볼 때 상재하중이 적어 앵커두부 보수시 안정성을 유지할 수 있을 것으로 판단된다.', '주의 관찰',  NULL, '20161226', '배성우', 'N')  ");
