        txn.executeSql("Insert into MANTB_DIGR01 Values ('SL2003-0000173', 3, 'E00192000072', '2017', '20160620',  '20161212', '202', NULL, 'E00192', '(주)동운',  '전준권', 7200, 'C', '가.  점검대상 사면에 대한 외관조사결과 사면 높이 50m, 경사 55~63&#65439;로 형성되어 있으며, 사면 외관상태 및 산마루 측구배수로, 낙석방지책, 낙석방지망, 숏크리트보강 등 시설물의 상태는 전반적으로 양호한 상태로 조사되어 전체적인 비탈면의 안정성에는 문제가 없으나, 일부구간에 , 암반이 노출되어 있으므로 풍화 및 우수에 의한 암탈락 . 숏크리트 숏크리트 점검시 주의깊게 할것으로 판단된다. 특히, 소단 낙석은 도로로 유입될 가능성이 크므로 제거가 필요하다고 판단된다. 나.  본 사면에 대해 전회 점검시(KICT, 2008.10.21)에 의한 평가등급은 “C”등급 상태로 조사 되었며, 금회 정밀점검시 외관조사를 토대로 시설물에 대한 상태평가를 실시한 결과 환산결함도 점수는 0.355로 상태평가 산정기준에 의거 주요부재에 결함이 발생하였으나, 전체적인 시설물의 안전에는 지장이 없으며, 주요부재의 내구성, 기능성 저하방지를 위한 보수가 필요하거나 보조부재에 간단한 보강이 필요한 \"C\"등급에 해당하는 것으로 평가되었다. 다. 대상 시설물의 외관조사에서 조사된 주요결함 및 손상부에 대하여 적절한 보수가 이루어 진다면 시설물의 안전등급은 상향조정이 가능할 것으로 판단되며, 보수 후에도 정기적인 점검 및 지속적인 유지관리를 통해 사면의 안전성 및 사용성을 최대한 확보하고, 문제점 발생시에는 즉각적인 대책을 수립ㆍ강구하여야 할 것으로 판단된다. ', '낙석방지망 보수 낙석제거 숏크리트 부분 보수',  NULL, '20161227', '박종용', 'N')  ");
